data:
  definition: caractère de commande destiné au remplissage d'une portion de support
    d'information ou d'un intervalle de temps et pouvant être inséré dans une suite
    de caractères ou en être retiré sans en modifier la signification
  examples: []
  notes:
  - Cependant la présence de ce caractère peut modifier la présentation des données
    ou la commande des appareils.
